import React from 'react';

function Tile(props) {

  function poner_foto(symbol){
    if (symbol === "AAPL"){
      return require("../imgs/apple.png");
    }

  }
    return (
      <section className="Tile">
        <p id="p_tile">{props.symbol}</p>

      </section>
    );
  }

  export default Tile;
